  async downloadPageDirectorios() {
    let data: any = null;
    try {
      data = await this.getPageDirectorios().toPromise();
    } catch (error) {
      this.scriptGL.printSnackbar(15, null, null, 'Ocurrio un problema de servidor, favor de contactar a soporte técnico.', 5, false, null, null);
      return true;
    }
    if (data) {
      const directorios: Array<DirectorioEmpresarialModel> = data;
      let workbook = new Workbook();
      workbook.views = [{ x: 0, y: 0, width: 10000, height: 20000, firstSheet: 0, activeTab: 1, visibility: 'visible' }];

      let worksheet: Worksheet = workbook.addWorksheet('Directorios empresariales');

      let alinearCentro: any = { vertical: 'top', horizontal: 'center', wrapText: true, shrinkToFit: true };
      let todosBordes: any = { top: { style: 'thin' }, left: { style: 'thin' }, bottom: { style: 'thin' }, right: { style: 'thin' } };
      let imageToExcel = workbook.addImage({
        base64: this.getImageBase64(),
        extension: 'png',
      });

      worksheet.mergeCells('F1:T1');
      worksheet.addImage(imageToExcel, 'F1:T1');
      worksheet.lastRow.height = 60;

      worksheet.mergeCells('A2:AG2');
      let a1 = worksheet.getCell('A2:AG2');
      a1.fill = { type: 'pattern', pattern: 'darkVertical', fgColor: { argb: '9D2449' }, bgColor: { argb: '9D2449' } };
      a1.value = 'REPORTE DE DIRECTORIOS EMPRESARIALES ';
      a1.font = { name: 'Calibri', color: { argb: 'FFFFFF' }, family: 4, size: 20 };
      a1.alignment = alinearCentro;
      a1.border = todosBordes;

      let fillSegundaFila: any = { type: 'pattern', pattern: 'darkVertical', fgColor: { argb: '285C4D' }, bgColor: { argb: '285C4D' } };
      let fontSegundaFila: any = { name: 'Calibri', color: { argb: 'FFFFFF' }, family: 4, size: 11 };
      worksheet.mergeCells('A3:AG3');
      let a2n2 = worksheet.getCell('A3:AG3');
      a2n2.value = '';
      a2n2.fill = fillSegundaFila;
      a2n2.font = fontSegundaFila;
      a2n2.alignment = alinearCentro;
      a2n2.border = todosBordes;

      let header = ['N°', 'Razón social', 'Nombre legal', 'Nombre comercial', 'Categoría', 'Sector principal', 'Sub-sector', 'Grupo', 'Régimen', 'RFC', 'Curp', 'Representante legal', 'Página web', 'Descripción', 'Comentarios adicionales', 'País', 'C.P.', 'Estado', 'Minicipio', 'Colonia', 'Calle y número', 'Teléfono', 'Correo', 'Parque industrial', 'Colaboradores M', 'Colaboradores F', 'Colaboradores C.D', 'Giro comercial', 'Monto anual', 'Monto exportación', 'Bolsa valores', 'Es maquiladora', 'Estatus'];
      let headerRow: Row = worksheet.addRow(header);
      let col = worksheet.columns;
      for (let x of col) {
        x.width = 12;
      }
      headerRow.eachCell((cell, number) => {
        cell.fill = { type: 'pattern', pattern: 'solid', fgColor: { argb: 'D4C19C' }, bgColor: { argb: 'D4C19C' } }
        cell.border = todosBordes
        cell.alignment = alinearCentro
      });
      if (directorios) {
        let contador = 0;
        for (let directorio of directorios) {
          let temp = [];
          contador++;
          temp.push(contador);
          temp.push(this.returnValor(directorio.razonSocial));
          temp.push(this.returnValor(directorio.nombreLegal));
          temp.push(this.returnValor(directorio.nombreComercial));
          temp.push(this.returnValorCatalogo(directorio.tipoEmpresa));
          temp.push(this.returnValorCatalogo(directorio.sectorPrincipal));
          temp.push(this.returnValorCatalogo(directorio.subSector));
          temp.push(this.returnValor(directorio.grupo));
          temp.push(this.returnValorCatalogo(directorio.regimen));
          temp.push(this.returnValor(directorio.rfc));
          temp.push(this.returnValor(directorio.curp));
          temp.push(this.returnValor(directorio.representanteLegal));
          temp.push(this.returnValor(directorio.paginaWeb));
          temp.push(this.returnValor(directorio.descripcion));
          temp.push(this.returnValor(directorio.comentarios));
          temp.push(this.returnValorCatalogo(directorio.pais));
          temp.push(this.returnValor(directorio.codigoPostal));
          temp.push(this.returnValorEstado(directorio.estado));
          temp.push(this.returnValorMunicipio(directorio.municipio));
          temp.push(this.returnValor(directorio.colonia));
          temp.push(this.returnValor(directorio.calle));
          temp.push(this.returnValor(directorio.telefono));
          temp.push(this.returnValor(directorio.correo));
          temp.push(this.returnValorCatalogo(directorio.parqueIndustrial));
          temp.push(this.returnValor(directorio.colabMasculinos));
          temp.push(this.returnValor(directorio.colabFemeninos));
          temp.push(this.returnValor(directorio.colabCapacDifer));
          temp.push(this.returnValor(directorio.giroComercial));
          temp.push(this.returnValor(directorio.montoAnual));
          temp.push(this.returnValor(directorio.montoExportacion));
          temp.push(this.returnValor(directorio.enBolsaValores));
          temp.push(this.returnValor(directorio.esMaquiladora));
          temp.push(this.returnValor(directorio.estatus));
          let temporal: Row = worksheet.addRow(temp);
          temporal.eachCell((cell, number) => {
            cell.alignment = alinearCentro,
              cell.border = todosBordes
          });
        }
      }
      let fname = "Directorios PEFCE";
      workbook.xlsx.writeBuffer().then((data) => {
        let blob = new Blob([data], { type: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet' });
        fs.saveAs(blob, fname + '.xlsx');
      });
      return true;
    } else {
      return true;
    }
  }

