  //Validadores para evitar espacios vacios
  returnValor(valor) {
    return valor ? valor : ' ';
  }

  returnValorCatalogo(valor: any) {
    return valor ? valor.nombre : ' ';
  }

  returnValorEstado(valor: any) {
    return valor ? valor.estado : ' ';
  }

  returnValorMunicipio(valor: any) {
    return valor ? valor.municipio : ' ';
  }

  returnValorFecha(valor) {
    return valor ? new Date(valor).toLocaleDateString() : ' ';
  }

  returnValorActivo(valor) {
    return valor ? 'Activo' : 'Inactivo';
  }

  returnValorLlaveValor(valor: any, llaveValor: string) {
    return valor ? valor[llaveValor] : ' ';
  }
  // peticiones
  getPageDirectorios(): Observable<any> {
    return this.http.get(`${this.baseUrl}/page/directorios`);
  }

  getPageCapacitaciones(): Observable<any> {
    return this.http.get(`${this.baseUrl}/page/capacitaciones`);
  }

  getPageContactos(): Observable<any> {
    return this.http.get(`${this.baseUrl}/page/contactos`);
  }

  getPageEventos(): Observable<any> {
    return this.http.get(`${this.baseUrl}/page/eventos`);
  }
  //Images
  getImageBase64() {
    return 'data:image/png;base64,';
  }
